import React from 'react';
 import billieJeanImage from "../assets/images.png";
 import beatItImage from "../assets/images.png";
 import smoothCriminalImage from "../assets/images.png";
import dontStopImage from "../assets/images.png";
import rockWithYouImage from "../assets/images.png" ;

import ramcc from "../songs/dd.mp3";
import dd1 from "../songs/dd1.mp3";
import dd2 from "../songs/dd2.mp3";
import dd3 from "../songs/dd3.mp3";
import dd4 from "../songs/dd4.mp3";
import dd5 from "../songs/dd5.mp3";
import dd6 from "../songs/dd6.mp3";
import dd7 from "../songs/dd7.mp3";
import dd8 from "../songs/dd8.mp3";
import dd9 from "../songs/dd9.mp3";

const SongTable = ({ onSongClick }) => {
  const songs = [
    {
        id: 1,
        title: 'Billie Jean',
        plays: '1,040,814,084',
        time: '2:52',
        album: 'Thriller 25',
        image: billieJeanImage,
        url: ramcc, // Use imported image
      },
      {
        id: 2,
        title: 'Beat It',
        plays: '643,786,045',
        time: '2:44',
        album: 'Thriller 25',
        image: beatItImage,
        uri:dd1,
      },
      {
        id: 3,
        title: 'Smooth Criminal',
        plays: '407,234,004',
        time: '4:17',
        album: 'Thriller 25',
        image: smoothCriminalImage,
        uri:dd2,
      },
      {
        id: 4,
        title: "Don't Stop 'Til You Get Enough",
        plays: '316,391,952',
        time: '6:05',
        album: 'Bad 25th Anniversary',
        image: dontStopImage,
        uri:dd3,
      },
      {
        id: 5,
        title: 'Rock With You',
        plays: '268,187,218',
        time: '3:40',
        album: 'Off The Wall',
        image: rockWithYouImage,
        uri:dd4,
      },
      {
        id: 1,
        title: 'Billie Jean',
        plays: '1,040,814,084',
        time: '4:53',
        album: 'Thriller 25',
        image: billieJeanImage,
        uri:dd5, // Use imported image
      },
      {
        id: 2,
        title: 'Beat It',
        plays: '643,786,045',
        time: '4:18',
        album: 'Thriller 25',
        image: beatItImage,
        uri:dd6,
      },
      {
        id: 3,
        title: 'Smooth Criminal',
        plays: '407,234,004',
        time: '4:17',
        album: 'Thriller 25',
        image: smoothCriminalImage,
        uri:dd7,
      },
      {
        id: 4,
        title: "Don't Stop 'Til You Get Enough",
        plays: '316,391,952',
        time: '6:05',
        album: 'Bad 25th Anniversary',
        image: dontStopImage,
        uri:dd8,
      },
      {
        id: 5,
        title: 'Rock With You',
        plays: '268,187,218',
        time: '3:40',
        album: 'Off The Wall',
        image: rockWithYouImage,
        uri:dd9,
      },
  ];

  return (
    <table className="song-table">
      <thead>
        <tr>
          <th>#</th>
          <th>Image</th>
          <th>Title</th>
          <th>Playing</th>
          <th>Time</th>
          <th>Album</th>
        </tr>
      </thead>
      <tbody>
        {songs.map((song, index) => (
          <tr key={song.id} onClick={() => onSongClick(song)}>
            <td>{index + 1}</td>
            <td>
              <img
                src={song.image}
                alt={song.title}
                style={{
                  width: '50px',
                  height: '50px',
                  borderRadius: '5px',
                  objectFit: 'cover',
                }}
              />
            </td>
            <td>{song.title}</td>
            <td>{song.plays}</td>
            <td>{song.time}</td>
            <td>{song.album}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default SongTable;
